import React, { useState } from "react";
import slide1 from "./images/slide-1.png";
import slide2 from "./images/slide-2.jpeg";
import slide3 from "./images/slide-3.jpeg";
import slide4 from "./images/slide-4.jpg";
import slide5 from "./images/slide-5.jpeg";
import "./slider.css";

import ReactDOM from "react-dom";
import "react-responsive-carousel/lib/styles/carousel.min.css"; // requires a loader

import ItemsCarousel from "react-items-carousel";
import { auto } from "@popperjs/core";
import Button from "react-bootstrap/Button";
import { Carousel } from "react-bootstrap";

function MainSlider() {
  const [index, setIndex] = useState(0);

  const handleSelect = (selectedIndex, e) => {
    setIndex(selectedIndex);
  };

 

  function clickHandler(){
    fetch("http://localhost:64169", {
      method : 'POST',
      headers: {
        'Accept': 'application/json',
        'Content-Type': 'application/json',
      },
      body: JSON.stringify({
     
       action:1
     
      })
    }).then((response) => response.json())
    .then((responseJson) => {

// Showing response message coming from the server after inserting records.
      alert.alert(responseJson);

    }).catch((error) => {
      console.error(error);
    });


}

  return (
    <div>
    <Carousel fade activeIndex={index} onSelect={handleSelect}>
      <Carousel.Item>
        <img className="d-block w-100" src={slide1} alt="First slide" />
        <Carousel.Caption>
          <h3>First slide label</h3>
          <p>Nulla vitae elit libero, a pharetra augue mollis interdum.</p>
        </Carousel.Caption>
      </Carousel.Item>
      <Carousel.Item>
        <img className="d-block w-100" src={slide2} alt="Second slide" />

        <Carousel.Caption>
          <h3>Second slide label</h3>
          <p>Lorem ipsum dolor sit amet, consectetur adipiscing elit.</p>
        </Carousel.Caption>
      </Carousel.Item>
      <Carousel.Item>
        <img className="d-block w-100" src={slide3} alt="Third slide" />

        <Carousel.Caption>
          <h3>Third slide label</h3>
          <p>
            Praesent commodo cursus magna, vel scelerisque nisl consectetur.
          </p>
        </Carousel.Caption>
      </Carousel.Item>
    </Carousel>
    <h1>Hello its test api</h1>
    <button onClick = {clickHandler}>Go</button>
    </div>
  );
}

